import { useState } from "react";

function listItem(item) {
  return <li>test</li>;
}

export default function App() {
  const [listItems, setListItems] = useState([]);
  return (
    <>
      <div className="listContainer">
        <ul>
          {listItems.map((item, idx) => {
            <listItem></listItem>;
          })}
        </ul>
      </div>
      <div>
        <button
          id="add"
          onClick={() => {
            setListItems([...listItems, listItem()]);
          }}
        >
          Add To Do
        </button>
      </div>
    </>
  );
}
